import React, { Component } from 'react';
import { pickTheme } from '../redux/actions'
import { connect } from 'react-redux';
import { ThemeProvider } from 'styled-components/native';
import { Container, HeaderContainer, HeaderText, Text } from '../theming/masterStyle'
import { FormArea, SignUpContent } from '../theming/signupStyle'
import { Button, ButtonText} from '../theming/settingsStyle'
import { Formik } from 'formik'
import { View, TextInput } from 'react-native'


class SignUp extends Component {
  render() {
      console.log(this.props.theme)
    return (
        <ThemeProvider theme={ this.props.theme }>

            <SignUpContent>
                <HeaderContainer>
                    <HeaderText>register</HeaderText>
                    <Text>register/sign in to the app using your uark credentials.</Text>
                </HeaderContainer>
                <FormArea>
                    <Formik 
                        initialValues={{ uarkEmail: '', uarkPassword: ''}}
                        onSubmit={(values) => {
                            console.log(values)
                        }}
                    >
                        {/* get access to props of Formik */}
                        {(props) => (
                            <View>
                                <TextInput 
                                    placeholder='UARK email' 
                                    onChangeText={props.handleChange('uarkEmail')} 
                                    value = {props.values.uarkEmail}
                                />
                                <TextInput 
                                    placeholder='UARK password' 
                                    onChangeText={props.handleChange('uarkPassword')} 
                                    value = {props.values.uarkPassword}
                                />
                                <Button onPress={() => props.handleSubmit}><ButtonText>get started!</ButtonText></Button>
                            </View>
                        )}
                    </Formik>
                    <Button onPress={() => this.props.navigation.navigate('Dashboard')}>
                            <ButtonText>go to Dashboard ...</ButtonText>
                        </Button>
                </FormArea>
            </SignUpContent>
        </ThemeProvider>
    );
  }
}

function mapStateToProps(state) {
    return {
        theme: state.themeReducer.theme
    }
}

export default connect(mapStateToProps, {pickTheme})(SignUp);
